import { Storage } from "../infrastructure/Storage";
import {
  InvlalidSessionTokenError,
  UsersRepository,
  UnauthorizedError,
} from "../infrastructure/repositories";
import { UserItem } from "../models/presentation/UserItem";

export class FetchUsersOutput {
  readonly users: UserItem[];

  constructor(users: UserItem[]) {
    this.users = users;
  }
}

export class FetchUsersUsecase {
  private usersRepository: UsersRepository;

  constructor(usersRepository: UsersRepository) {
    this.usersRepository = usersRepository;
  }

  async fetch(): Promise<FetchUsersOutput> {
    const sessionToken = Storage.restoreSessionToken() || null;
    if (!sessionToken) {
      return Promise.reject(new InvlalidSessionTokenError());
    }

    try {
      const data = await this.usersRepository.fetch(sessionToken);
      const users = data.results.map(
        (user: any) =>
          new UserItem({
            id: user.id,
            code: user.code,
            name: user.name,
            status: user.status,
            email: user.email,
          })
      );
      return new FetchUsersOutput(users);
    } catch (e) {
      if (e instanceof UnauthorizedError) {
        Storage.clear();
      }
      throw e;
    }
  }
}
